/*Table structure for table `tbl_pembelian` */

DROP TABLE IF EXISTS `tbl_pembelian`;

CREATE TABLE `tbl_pembelian` (
  `invoice` varchar(100) NOT NULL,
  `tgl_invoice` date DEFAULT NULL,
  `tgl_input` datetime DEFAULT CURRENT_TIMESTAMP,
  `total_qty` int(11) DEFAULT NULL,
  `total_harga_pokok` double(12,2) DEFAULT NULL,
  `total_harga_jual` double(12,2) DEFAULT NULL,
  `lokasi` varchar(7) DEFAULT NULL,
  `updatedate` datetime DEFAULT CURRENT_TIMESTAMP,
  `updateby` varchar(100) DEFAULT NULL,
  `tgl_batal` datetime DEFAULT NULL,
  `user_pembatal` varchar(100) DEFAULT NULL,
  `is_aktif` tinyint(1) DEFAULT '1' COMMENT '1=aktif, 2=batal',
  `is_upload` tinyint(1) DEFAULT '0',
  `tgl_upload` datetime DEFAULT NULL,
  PRIMARY KEY (`invoice`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

