  `user_pembatal` varchar(100) DEFAULT NULL,
  `is_aktif` tinyint(1) NOT NULL DEFAULT '1' COMMENT 'ref ke tabel tbl_status_transaksi',
  `is_upload` tinyint(1) DEFAULT '0' COMMENT '0=belum di upload, 1=sudah di upload',
  `tgl_upload` datetime DEFAULT NULL,
  PRIMARY KEY (`no_transaksi`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;

